import React, { useEffect, useState } from "react";

const Home = () => {
    const [isDark, setDark] = useState(false)




    return (
        <main className="p-5">
            <h1>
                Hello world!
            </h1>
            <ul >
                <li className="first:bg-green-500 first:text-white">Yoda</li>
                <li className="first:bg-green-200 odd:bg-blue-600 odd:text-white even:bg-red-600">Sith</li>
                <li className="first:bg-green-200 odd:bg-blue-600 odd:text-white even:bg-red-600">Jedi</li>
                <li className="first:bg-green-200 odd:bg-blue-600 odd:text-white even:bg-red-600">Sith</li>
                <li className="first:bg-green-200 odd:bg-blue-600 odd:text-white even:bg-red-600">Jedi</li>
            </ul>

            <div className="shadow-lg p-5 my-20 rounded-3xl dark:bg-black">
                <h4 className="text-xl dark:text-white">May the Force be with you</h4>
                <p className="text-slate-400">The darkside of the force is the pathway to many abilities that consider to be unnatural...</p>
                <button id="darkTheme" className="mt-8 rounded-md bg-black hover:bg-slate-800 dark:bg-black hover:bg-slate-800 text-white px-6 py-2" onClick={setDark}>Dark</button>
            </div>
        </main>
    );
};

export default Home;
